ProductDescriptionLong:
Reveal a renewed complexion with an anti-aging concealer formulated to provide a three-part holistic rejuvenation to the skin. With continued use, the look of lines and wrinkles are diminished as skin appears visibly smoother, plumper, firmer, brighter, and more hydrated.
&nbsp;
Corrective Prevention: Stimulate age intervention deep in the skin with encapsulated dipeptide Carnosine and antioxidants Silybum Marianum Fruit Extract and Tocopherol (Vitamin E) delivered effectively via a liposomal complex. This trio of age-fighters work together to reduce the appearance of lines and wrinkles, revitalize skin, increase elasticity, and prevent the stiffening and breakdown of collagen through glycation.
&nbsp;
Hydration &amp; Anti-Inflammation: Inhibit inflammation and dryness with Australian Myrtle Oil and Bisabolol (derived from German Chamomile), both offering hydrating, anti-inflammatory, and anti-microbial properties to soothe redness and heal blemishes.
&nbsp;
Youthful Radiance: Counteract the look of dark shadows, lines and wrinkles, enlarged pores, and uneven tone around the entire eye area and throughout the face with long wear, light diffusing pigments.
&nbsp;
&nbsp;
